import React from "react";
import "./CRUDAdmin.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Table,
  Button,
  Container,
  Modal,
  ModalHeader,
  ModalBody,
  FormGroup,
  ModalFooter,
} from "reactstrap";

class vistaTorneos extends React.Component {
  state = {
    data: [],
    dataFiltrada: [],
    busqueda: "",
  };

  componentDidMount() {
    fetch("http://127.0.0.1:5000/admin/torneo/readtorneos")
      .then((response) => response.json())
      .then((data) => {
        this.setState({ data: data, dataFiltrada: data });
      })
      .catch((error) => {
        alert("Error al obtener datos del servidor:", error);
      });
  }

}


export default CRUDAdmin;
